import '../C_dashboard/style_dashboard.css';
import rms_logo from "../C_dashboard/icons/rms_logo"
import React from 'react';

function RMSlogo(props) {
  
  return (    
    <div class="rmstag">   
        <img src={rms_logo} className="user_profile" alt="icon" />
        <div class="rms_title">
            <div class="rms">Resource</div>
            <div class="rms">Management</div>
            <div class="rms">System</div>
        </div>        
    </div>  
  );
}

export default RMSlogo;
